$(document).ready(function () {
  $(".menu").mmenu({
    "navbar": {
      "title": '<img src="../../assets/img/logo-white.png">'
    },
    "extensions": [
      "pagedim-black",
      "position-right",
      "theme-dark"
    ],
    "counters": true,
    "iconbar": {
      "use": true,
      "top": [
        "<a href='/'><i class='fal fa-home'></i></a>"
      ],
      "bottom": [
        "<a href='mailto:office@elitaplus.kg'><i class='fal fa-envelope'></i></a>",
        "<a href='tel:+996555555555'><i class='fal fa-mobile'></i></a>",
        "<a href='tel:++996777777777'><i class='fal fa-mobile'></i></a>",
        "<a href='#'><i class='far fa-map-marker-alt'></i></a>",
      ]
    },
    "navbars": [{
        "position": "bottom",
        "content": [
          "<a href='#' trarget='_blank'><i class='fab fa-facebook-f''></i></a>",
          "<a href='#' trarget='_blank'><i class='fab fa-instagram'></i></a>",
          "<a href='#' trarget='_blank'><i class='fab fa-twitter'></i></a>",
          "<a href='#' trarget='_blank'><i class='fab fa-youtube'></i></a>",
          "<a href='#' trarget='_blank'><i class='fab fa-whatsapp'></i></a>",
          "<a href='#' trarget='_blank'><i class='fab fa-telegram-plane'></i></a>"
        ]
      },
      {
        "position": "top",
        "content": [
          "searchfield"
        ],
        "searchfield": {
          "showSubPanels": false
        }
      }
    ],
  });
  var API = $('.menu').data("mmenu"),
    $icon = $(".hamburger");
  $icon.click(function () {
    API.open();
  });
  API.bind("open:finish", function () {
    $icon.addClass("hamburger--open");
  });
  API.bind("close:finish", function () {
    setTimeout(function () {
      $icon.removeClass("hamburger--open");
    }, 100);
  });

});

// news  
let heightTitleNew = $('.entry__wrap .news:first').find('.news__title').outerHeight();
let heightPreviewNew = $('.entry__wrap .news:first').find('.news__preview').outerHeight();

let total = heightTitleNew + heightPreviewNew;
$('.entry__wrap .news:first').find('.category').css('bottom', total + 39);
// $('.entry .news__desc:not(:first)').remove();

// news end


// title
$('.overlay h2').each(function () {
  var title = $(this).text();
  $(this).append('<span class="title__overlay">' + title + '</span>');
});
// title end

// search
$('.search-js').on('click', function () {
  $(this).addClass('trigger-search');
  $('.search-form__trigger').addClass('border');
});

$('.search-form__input').on('click', function () {
  $('.search-js').addClass('trigger-search');
  $('.search-form__trigger').addClass('border');
});

$(document).mouseup(function (e) {
  var div = $(".search-js");
  if (!div.is(e.target) &&
    div.has(e.target).length === 0) {
    div.removeClass('trigger-search');
    $('.search-form__trigger').removeClass('border');
  }
});
// search end


// phone mask
$(".phone-js").inputmask({
  "mask": "0 (999) 999-999"
});
// phone mask end 





// filter select dropdown
$('.select').on('click', function () {
  $(this).children('.select__dropdown').slideToggle();
});
$('.select__option').on('click', function () {
  let value = $(this).attr('data-value');
  $(this).parent().parent().find('.select-item').val(value);
  $(this).parent().parent().find('.select_checked').text(value);
});
$(document).mouseup(function (e) {
  var div = $(".select");
  if (!div.is(e.target) &&
    div.has(e.target).length === 0) {
    $('.select__dropdown').slideUp();
  }
});
// filter select dropdown end

// popup
$('.popup-wrap').on('click', function () {
  $(this).hide();
});
// popup end


